import React, { useEffect, useState } from 'react';
import { getParkingLogs } from '../services/apiService';

const ParkingLog = () => {
  const [logs, setLogs] = useState([]);

  useEffect(() => {
    const fetchLogs = async () => {
      try {
        const data = await getParkingLogs();
        setLogs(data);
      } catch (err) {
        console.error('Error fetching logs:', err);
      }
    };

    fetchLogs();
  }, []);

  return (
    <div>
      <h2>Parking Logs</h2>
      <table border="1" style={{ width: '100%', textAlign: 'center', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th>License Plate</th>
            <th>Entry Time (Nepal Time)</th>
            <th>Exit Time</th>
            <th>Fee (NPR)</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log, index) => (
            <tr key={index}>
              <td>{log.licensePlate}</td>
              <td>{log.entryTime}</td>
              <td>{log.exitTime}</td>
              <td>{log.fee}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ParkingLog;
